import React, { useMemo, useState, useCallback, useEffect } from 'react';

import DataTable from 'react-data-table-component';
import axios from "axios";

export default function PTable(){

        const [parkLot, setParkLot] = useState([]);

    const retrieveAllParkingLots = () =>{

        axios.get(`http://localhost:8080/apiv1/parkingLot/all`).then(response => {
            setParkLot(response.data);
            console.log(response);
        }).catch(error => {
            console.log(error)
        })
    }

        const [selectedRows, setSelectedRows] = useState([]);

        useEffect(() => {

            console.log('state', selectedRows);
        }, [selectedRows]);

        const handleButtonClick = () => {

            console.log('clicked');
        };

        const handleChange = useCallback(state => {
            setSelectedRows(state.selectedRows);
        }, []);

        const columns = useMemo(
            () => [
                {

                    cell: () => <button onClick={handleButtonClick}>Action</button>,
                    ignoreRowClick: true,
                    allowOverflow: true,
                    button: true,
                },
                {
                    name: 'Name',
                    selector: row => row.name,
                    sortable: true,
                    grow: 2,
                },
                {
                    name: 'Type',
                    selector: row => row.type,
                    sortable: true,
                },
                {
                    name: 'Calories (g)',
                    selector: row => row.calories,
                    sortable: true,
                    right: true,
                },
                {
                    name: 'Fat (g)',
                    selector: row => row.fat,
                    sortable: true,
                    right: true,
                },
                {
                    name: 'Carbs (g)',
                    selector: row => row.carbs,
                    sortable: true,
                    right: true,
                },
                {
                    name: 'Protein (g)',
                    selector: row => row.protein,
                    sortable: true,
                    right: true,
                },
                {
                    name: 'Sodium (mg)',
                    selector: row => row.sodium,
                    sortable: true,
                    right: true,
                },
                {
                    name: 'Calcium (%)',
                    selector: row => row.calcium,
                    sortable: true,
                    right: true,
                },
                {
                    name: 'Iron (%)',
                    selector: row => row.iron,
                    sortable: true,
                    right: true,
                },
            ],
            [],
        );

        return (
            <DataTable
                title="Desserts"
                data={retrieveAllParkingLots}
                columns={columns}
                selectableRows
                onSelectedRowsChange={handleChange}
            />
        );


}
